import React from "react";
import "./Anasayfa.css";
import { BrowserRouter, Link, Route, Routes, Switch } from "react-router-dom";
import AnasayfaIcerik from "./AnasayfaIcerik";

export default function Anasayfa() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <div className="AnasayfaContainer">
            <div className="heading">
              <h1>YEMEK DEPOSU</h1>
              <h3>DOLU DOLU DEPO</h3>
              <Link to="/orderpizza">
                <button>SİPARİŞ VER</button>
              </Link>
            </div>
            <img
              src="https://img-s1.onedio.com/id-5ffd792c5807749a5bc848ed/rev-0/w-620/f-jpg/s-38e816c62b3107b06adc05609612c76fe2859c5a.jpg"
              alt="Pizza"
            />
          </div>
        </Route>
        <Route exact path="/orderpizza">
          <AnasayfaIcerik />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}
